import React, { useState } from 'react';
import './SignInPage.css';  // Assuming this is the correct import for your CSS file

function SignInPage() {
  const [FullName, setFullName] = useState('');
  const [Mobile, setMobile] = useState('');
  const [Email, setEmail] = useState('');
  const [password, setPassword] = useState('');
  const [errorMessages, setErrorMessages] = useState({
    FullName: '',
    Mobile: '',
    Email: '',
    password: '',
  });

  const handleCombined = (e) => {
    e.preventDefault();  // Prevents the default form submission behavior
    handleProceed();
  };

  const handleProceed = () => {
    const isValid = validateInputs();

    if (isValid) {
      const formData = {
        FullName,
        Mobile,
        Email,
        password,
      };

      console.log('Form submitted:', formData);

      // You can add logic to send the form data to the server or perform further actions.
    } else {
      console.log('Form submission failed. Please enter valid information.');
    }
  };

  const validateInputs = () => {
    const numberRegex = /^\d+$/;
    const emailRegex = /^[^\s@]+@[^\s@]+\.[^\s@]+$/;

    let isValid = true;

    const validateField = (fieldName, value, length, regex, errorMessage) => {
      if (!value || (length && value.length !== length) || (regex && !regex.test(value))) {
        setErrorMessages((prevErrors) => ({
          ...prevErrors,
          [fieldName]: errorMessage,
        }));
        isValid = false;
      } else {
        setErrorMessages((prevErrors) => ({ ...prevErrors, [fieldName]: '' }));
      }
    };

    validateField('FullName', FullName, 0, null, 'Please enter your full name.');
    validateField('Mobile', Mobile, 10, numberRegex, 'Please enter a valid 10-digit mobile number.');
    validateField('Email', Email, 0, emailRegex, 'Please enter a valid email address.');
    validateField('password', password, 0, null, 'Please enter your password.');

    return isValid;
  };

  return (
    <div className='org'>
      <div className='form-container container'>
        <h2>Sign In</h2>
        <form className='forinner container'>
          <div className='form-group'>
            <label>Full Name <span style={{ color: 'red' }}>*</span> :</label>
            <input
              type='text'
              className='form-control'
              placeholder='ex: John Doe'
              value={FullName}
              onChange={(e) => setFullName(e.target.value)}
            />
            <p className='error-message'>{errorMessages.FullName}</p>
          </div>

          <div className='form-group'>
            <label>Mobile <span style={{ color: 'red' }}>*</span> :</label>
            <input
              type='text'
              className='form-control'
              placeholder='ex: 9876543210'
              value={Mobile}
              onChange={(e) => setMobile(e.target.value)}
            />
            <p className='error-message'>{errorMessages.Mobile}</p>
          </div>

          <div className='form-group'>
            <label>Email <span style={{ color: 'red' }}>*</span> :</label>
            <input
              type='text'
              className='form-control'
              placeholder='ex: example@gmail.com'
              value={Email}
              onChange={(e) => setEmail(e.target.value)}
            />
            <p className='error-message'>{errorMessages.Email}</p>
          </div>

          <div className='form-group'>
            <label>Password <span style={{ color: 'red' }}>*</span> :</label>
            <input
              type='password'
              className='form-control'
              placeholder='ex: Abc@123'
              value={password}
              onChange={(e) => setPassword(e.target.value)}
            />
            <p className='error-message'>{errorMessages.password}</p>
          </div>

          <button className='btn btn-success my-2' onClick={handleCombined}>
            Sign In
          </button>
        </form>
      </div>
    </div>
  );
}

export default SignInPage;
